 * @param aMediaType
 * @return
 */
public static boolean isAtomMediaType(String aMediaType) {
	return (aMediaType == null || aMediaType.length() < 3) ? false
			: ATOM_MEDIA_TYPE_PATTERN.matcher(aMediaType).matches();
}

